import React from "react";
import TransactionItem from "./TransactionItem";

export default () => {
  const transactions = [];

  const renderTransactions = () => {
    for (let i = 0; i < 10; i++) {
      transactions.push(
        <div key={i}>
          <table class="ui celled table">
            <thead>
              <tr>
                <th>Date</th>
                <th>Description</th>
                <th>Category</th>
                <th>Amount</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <TransactionItem />
              </tr>
            </tbody>
          </table>
        </div>
      );
    }

    return transactions;
  };

  return <div>{renderTransactions()}</div>;
};
